import React from "react";
import styles from "./AboutMe.module.css"
import { motion } from "framer-motion"
import{ faArrowDown } from "@fortawesome/free-solid-svg-icons"
import{ FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import imagen from "../../images/imagen.jpg";
import {faBootstrap, faCss3, faFacebook, faGit, faGithub, faHtml5, faJs, faNodeJs, faReact} from "@fortawesome/free-brands-svg-icons";
import {useTranslation} from "react-i18next";
import { t } from "i18next";
function AboutMe (){
    const[t,i18n]= useTranslation("global");
return  ( 
    <div className={styles.containerPadre}>
<h1> </h1>
        <div className={styles.container}>
            <div className={styles.hijoUno}>
                <div className={styles.imagenLautaro}>
                    <img className={styles.imagen} src={imagen} /> 
                </div>
                <div className={styles.Title}>
                    <motion.div className={styles.box}
                        animate={{
                        x:50, y:100, opacity:1
                        }}
                        transition={{
                        delay:0.4,
                        x:{type:"spring", stiffness:500},
                        default:{duration:4}
                        }}> 
                        <h2><FontAwesomeIcon className={styles.icono} icon={faArrowDown}/></h2>
                    </motion.div>
                    <h2 className={styles.aboutMeTitle}>About Me </h2>

                </div>
                
            </div>

            <div className={styles.hijoDos}>
           

                <div className={styles.containerPresentation}>
                        <div className={styles.englishPresentation}>  
                        <spam className={styles.spam1}> My name is Lautaro I am originally from Buenos Aires-Argentina but I am Italian too.</spam>
                        <spam className={styles.spam2}> I am currently  living in the UK from 2020 after living in Spain for almost 3 years. </spam>  
                        <spam className={styles.spam3}>My hobbies are going to the gym , watching a lot of series and sitting for hours programming and discovering new stuff!</spam>
                        <spam className={styles.spam4}>All my life I have loved the IT world but I never knew what area to work in.</spam>
                        <spam className={styles.spam5}>Thanks to the search I found this wonderful world of the Front-End where I can be creative and logical at the same time.</spam>
                        <spam className={styles.spam6}>After studying and practicing many hours I am ready for my first experience.</spam>
                        </div>
                </div>
                <div className={styles.containerPresentationResponsive}>
                    <p>
                        My name is Lautaro I am originally from Buenos Aires-Argentina but I am Italian too.
                        I am currently  living in the UK from 2020 after living in Spain for almost 3 years.
                        My hobbies are going to the gym , watching a lot of series and sitting for hours programming and discovering new stuff!
                        All my life I have loved the IT world but I never knew what area to work in,Thanks to the search I found this wonderful world of the Front-End where I can be creative and logical at the same time.
                        After studying and practicing many hours I am ready for my first experience
                    </p>
                </div>
            </div>  
        </div>
     
            <div className={styles.container2}>
                
            <h3>
                Skills
            </h3>
                    <motion.div className={styles.box2}
            animate={{
            rotate: [0, 0, 0, 0, 0],
            borderRadius: ["20%", "10%", "10%", "10%", "10%"],
            }}
            transition={{from:5, duration:3,repeat:0}}> 
            <FontAwesomeIcon className={styles.icono1} icon={faHtml5}/>
            <FontAwesomeIcon className={styles.icono2} icon={faCss3}/>
            <FontAwesomeIcon className={styles.icono3} icon={faJs}/>
            <FontAwesomeIcon className={styles.icono4} icon={faReact}/>
            <FontAwesomeIcon className={styles.icono5} icon={faBootstrap}/>
            <FontAwesomeIcon className={styles.icono6} icon={faGithub}/>
            <FontAwesomeIcon className={styles.icono7} icon={faNodeJs}/>
            <FontAwesomeIcon className={styles.icono8} icon={faGit}/>
        </motion.div>
            </div>
    </div>
);
}
export default AboutMe;
